long_desc.thetext:
The following lines cause a different, more evil stack overflow.

#include <windows.h>
#include <comdef.h>

The overflow is captured in the second attachment.

Ooof. Turns out to be a difference between gcc and cl (msvc). An example of the code (similar to _com_ptr_t) is:

1 template <class T> class C {
2   template<typename G> C(G *) { }
3   template<> C(char *) { }
4 };

This compiles with msvc but not with gcc. Line 3, according to Barney (Bjarne), is short for 'template<char> C(char *) {}'. Apparently the compiler has enough info to figure out that the template argument is supposed to be char. I guess gcc isn't smart enough. Or is the shortcut not part of the standard?

At any rate, the stack overflow happens whey you use the shortcut, template<>, and not when you use the full cut, template<char>.

Oops, I meant:

template<> C(char *) {}

is a shortcut for:

template<> C<char>(char *) {}

and it is covered in sectino 14.7 clause 3.

O.K, got one:

template <typename T> class C {
public:
  void * blah;
  template <typename G> C(G * g) : blah(g) {}
  template <> C(char * c) : blah(c) {}
};

O.K., here's a new example that still causes the overflow:

template <class T> class C {
public:
	void * blah;
	template <typename G> C(G *) : blah(g) { }
	template <> C(char *) : blah(g) { }
	template <> C(wchar_t *) : blah(g) { }
};

It got by the first specialization, but then puked on the second one.

3.2

We have an object contribution whose selectionChanged method simply hangs onto the selection, but does not change its enabled state.
Previously (I believe as recently as the 3.2 release candidates), this action would always be enabled as long as it met the selection criteria (right kind of object and size) specified in the plugin.xml.  Now it's disabled by default, and remains disabled since we don't change the enablement in code.

I believe this is due to the following optimization in SelectionEnabler:
		// Optimize it.
		if (mode == UNKNOWN) {
			return false;
		}

Since the action delegate is in the same plugin as the view (and its plugin is therefore activated), it gets instantiated fairly early when reading the extension (set a breakpoint in its constructor to see this) and the corresponding PluginAction gets its enablement updated with false.  This doesn't get changed later.

We might want to double-check this. javac is using the package default visibility in this case.

Test case:
Using 1.5 libraries, compile the following code:

import java.lang.reflect.*;

public class X {
	interface I {}
	public void test() throws NoSuchMethodException, IllegalAccessException, InvocationTargetException {

		class LocalClass {
			public void qq() {
			}
		};
		LocalClass action = new LocalClass();
		action.qq();
		action.getClass().getMethod("qq", (Class[])null).invoke(action, (Object[])null);
		Class cc = action.getClass();
		System.out.println("TEST: enclosing class = " + cc.getEnclosingClass());
		System.out.println("TEST: declaring class = " + cc.getDeclaringClass());
		System.out.println("TEST: is local class = " + cc.isLocalClass());
	}

	public abstract class MyClass {
	}

	public void test2() throws NoSuchMethodException, IllegalAccessException, InvocationTargetException {

		MyClass action = new MyClass() {
			public String qq() {
				return "qq";
			}
		};
		action.getClass().getMethod("qq", null).invoke(action, null);
	}

	public static void main(String args[]) {

		X t = new X();
		try {
			t.test();
			t.test2();
		} catch (Exception e) {
			e.printStackTrace();
		}
	}
}
